■商品特徴<br>
ホワイト・マルチ（文字盤カラー）ブラック・黒(ベルトカラー)<br>ステンレス（ケース素材）レザー（ベルト素材）表示方式 <br>アナログ駆動方式 クォーツ（電池式）<br>防水性 日常生活防水風防 ミネラルクリスタルガラス機能1 <br>４年電池/インデックス「7」部分に天然ダイヤ入商品状態 <br>新品未使用ケースサイズ：30x25x7mm(縦x横x厚) <br>※ケースサイズにはリューズを含んでおりません腕周り<br>：120～165mm重量：30gベルト幅：8～10mm専用ケース取扱説明書保証書 <br>
■仕様：クォーツ、日常生活防水、4年電池、天然ダイヤ入<br>
■付属品：専用ケース、保証書、取扱説明書 <br><style type="text/css">
